import React from 'react';
import { useNavigate } from 'react-router-dom';
import Dropdown from 'react-bootstrap/Dropdown';
import { useState } from 'react';

const CompetitorView = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleDropdown = () => {
        setIsOpen(!isOpen);
    };
    const navigate = useNavigate();
    const navig = () => {
        navigate('/Home')
    }
    return (
        <div className="d-flex justify-content-center align-items-center vh-100 text-primary">
            <div className="bg-black p-5 rounded d-inline-block" style={{ maxWidth: '600px', width: '80%', height:"40%" }}>
                <h1 className=" text-center">Hello</h1>
                <h5  className="text-center"> Start Date End Date</h5>
                <button className='btn btn-primary d-block mx-auto' onClick={navig}> Sign Up!</button>
            </div>
            <button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#customModal">
  Launch Custom Modal
</button>


<div class="modal custom-fade" id="customModal" tabindex="-1" aria-labelledby="customModalLabel" aria-hidden="true">
  <div class="modal-dialog modal-dialog-centered">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="customModalLabel">Custom Modal Title</h5>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">
        Custom Modal Content Goes Here
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
        <button type="button" class="btn btn-primary">Save changes</button>
      </div>
    </div>
  </div>
</div>
        </div>
    );
};

export default CompetitorView;
